using System;\nusing System.IO;\nusing YamlDotNet.Serialization;\nusing YamlDotNet.Serialization.NamingConventions;\n\npublic class Level\n{\n    public string[] TerrainTypes { get; set; }\n    public GameObject[] Objects { get; set; }\n}\n\npublic class GameObject\n{\n    public string Type { get; set; }\n    public Position Position { get; set; }\n}\n\npublic class Position\n{\n    public int X { get; set; }\n    public int Y { get; set; }\n}\n\npublic class Program\n{\n    public static void Main()\n    {\n        var deserializer = new DeserializerBuilder()\n            .WithNamingConvention(CamelCaseNamingConvention.Instance)\n            .Build();\n\n        string yamlString = File.ReadAllText("level.yaml");\n        Level level = deserializer.Deserialize<Level>(yamlString);\n        \n        // Use the level data\n        Console.WriteLine(string.Join(", ", level.TerrainTypes));\n    }\n}